import { useEffect, useState } from "react";
import Card from "../UI/Card";

const Home = () => {
    const [emailData, setEmailData] = useState([]);
    useEffect(()=>{
        fetch('http://localhost:8000/data').then(
            (response) => {
                return response.json()
            }
        ).then((data)=>{
            console.log(data);
            // const email = data.map(d => {
            //     return { 
            //         time: d.time,
            //         subject: d.subject,
            //         from: d.from,
            //         message:d.message,
            //         reply: d.replies
            //     }
            // })
            // console.log("email ",email)
        setEmailData(data);
        })
    },[])

    console.log("emaildata " + emailData[0].subject);
    return(
        <div>
            <h1>Mailbox</h1>
            <ul>
                {
                    emailData.map((email)=>(
                        <Card>
                             <li>
                                <h2>{email.from}</h2>
                                <h3>{email.subject}</h3>
                                <p>{email.message}</p>
                            </li>
                        </Card>
                    ))
                }
            </ul>
        </div>
    )
}

export default Home;
